import Section from "./Section";

const Programme = () => {
  return (
    <Section>
      <div>
        {/* Le contenu de la section Programme */}
        <h3 className="text-xl font-semibold mb-4">Programme de la journée</h3>
        <ul>
          <li>16h00 - Accueil des invités</li>
          <li>17h00 - Cérémonie</li>
          <li>18h00 - Cocktail</li>
          <li>20h00 - Dîner</li>
          {/* Ajouter le reste du programme */}
        </ul>
      </div>
    </Section>
  );
};

export default Programme;
